(59, 3, '2021-11-21 22:35:48', '2021-11-21 22:35:48', '<!-- wp:paragraph -->\n<p>Magic is awesome. The rarest card is the black lotus its not very bad or good, it is a artifact and if you use it you will sacrifice it for 3 mana of your choice. this is what it says, You must play both B.F.M. cards to put B.F.M. into play. if either B.F.M. card leaves play, sacrifice the other. B.F.M. can be blocked only by three or more creatures. Its a 99/99 and it costs 15 mana. There can be extra power like things like Vigilance, it makes it so that you do not need to tap your card to attack, There\'s also trample if your creature is blocked then the attack damage that is not blocked is sent to the opponent, flying you can\'t be blocked by most creatures, There\'s probably more but I cant think of more. If you tap a card it means that you are using it for a attack or to use something else like haste for another creature.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://m.media-amazon.com/images/I/51ASzCTLFtL._AC_.jpg\" alt=\"Amazon.com: Ultra Pro Magic the Gathering Card Back Deck Protector New (80)  Count : Toys &amp; Games\"/><figcaption>back of magic card</figcaption></figure>\n<!-- /wp:image -->', 'Magic the gathering', '', 'publish', 'open', 'open', '', 'magic-the-gathering', '', '', '2021-11-21 23:44:40', '2021-11-21 23:44:40', '', 0, 'https://orin.fuzzylojic.com/?p=59', 0, 'post', '', 2),
(60, 3, '2021-11-21 22:35:48', '2021-11-21 22:35:48', '<!-- wp:paragraph -->\n<p>Magic is awesome. The rarest card is the black lotus its not very bad or good, it is a artifact and if you use it you will sacrifice it for 3 mana of your choice. this is what it says, You must play both B.F.M. cards to put B.F.M. into play. if either B.F.M. card leaves play, sacrifice the other. B.F.M. can be blocked only by three or more creatures. Its a 99/99 and it costs 15 mana. There can be extra power like things like Vigilance, it makes it so that you do not need to tap your card to attack, There\'s also trample if your creature is blocked then the attack damage that is not blocked is sent to the opponent, flying you can\'t be blocked by most creatures, There\'s probably more but I cant think of more. If you tap a card it means that you are using it for a attack or to use something else like haste for another creature.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://m.media-amazon.com/images/I/51ASzCTLFtL._AC_.jpg\" alt=\"Amazon.com: Ultra Pro Magic the Gathering Card Back Deck Protector New (80)  Count : Toys &amp; Games\"/><figcaption>back of magic card</figcaption></figure>\n<!-- /wp:image -->', 'Magic the gathering', '', 'inherit', 'closed', 'closed', '', '59-revision-v1', '', '', '2021-11-21 22:35:48', '2021-11-21 22:35:48', '', 59, 'https://orin.fuzzylojic.com/?p=60', 0, 'revision', '', 0),
(64, 3, '2021-11-21 22:47:50', '2021-11-21 22:47:50', '<!-- wp:paragraph -->\n<p>11/21/2021.       I\'m not traveling yet but I will start on december 30th 2021. I\'m going to mexico fist for 2 months then costa rica for 2 months and then ecuador 4 2 months than columbia for 2 months then peru 4 2 months</p>\n<!-- /wp:paragraph -->', 'traveling news 1', '', 'publish', 'open', 'open', '', 'traveling-news-1', '', '', '2022-03-17 15:27:52', '2022-03-17 15:27:52', '', 0, 'https://orin.fuzzylojic.com/?p=64', 0, 'post', '', 0),
(65, 3, '2021-11-21 22:47:50', '2021-11-21 22:47:50', '<!-- wp:paragraph -->\n<p>11/21/2021.       I\'m not traveling yet but I will start on december 30th 2021. I\'m going to mexico fist for 2 months then costa rica for 2 months and then I think peru for 2 months and then I dont know bye.</p>\n<!-- /wp:paragraph -->', 'traveling news 1', '', 'inherit', 'closed', 'closed', '', '64-revision-v1', '', '', '2021-11-21 22:47:50', '2021-11-21 22:47:50', '', 64, 'https://orin.fuzzylojic.com/?p=65', 0, 'revision', '', 0),
