(148, 3, '2021-12-14 00:43:59', '2021-12-14 00:43:59', '<!-- wp:paragraph -->\n<p>Story of the day 12/13/2021                                                                                                                                                                                       </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The Universe book 1</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The big bang may have started the universe but a question that has been on the minds of many scientists is what caused the big bang and that is a hero called The Universe. He was born at the start of time outside of time he used the power he knew he had and created the universe, then out of nowhere two big humans\"?\" told him to make this oath to gain his full power so he did. \"I The Universe swear to protect the entire universe at all costs.\" A huge explosion (AKA the big bang) gave him his full power. 14,000,000,000 years later. The human known as super F in his secret identity Finneas Enniott was walking down the street to the pet store, BOB\'S PETS. He went in and bought a green rabbit and a blue cat the most rare pets costing 1,000,000 dollars. Then, a strange blue man with gold and black armor and green ovals on his arms took his rabbit and ripped a green gem out of it\'s body and teleported away. The Universe  flew down and told him that he knew his secret identity. That was a villain called HIM. And that the gem had the power of space and time and you could also teleport with it and that the fate of the universe depended on them.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The end for now the next book will be made tomorrow.</p>\n<!-- /wp:paragraph -->', 'The Universe 1', '', 'publish', 'open', 'open', '', 'the-universe-1', '', '', '2021-12-14 00:47:30', '2021-12-14 00:47:30', '', 0, 'https://orin.fuzzylojic.com/?p=148', 0, 'post', '', 0),
