(151, 3, '2021-12-15 01:14:28', '2021-12-15 01:14:28', '<!-- wp:paragraph -->\n<p>In the last book we \"saw\" The Universe\'s origin and the begging of time. There was also a villain that never did much but lets just start this story. The Universe and super F where transported to a black room. \"We are now in the training room\" Said The Universe \"Here you will be challenged and trained\" \"Goodbye\" BZZT The Universe teleported away to a huge castle made with rubys and something related to dark matter. The castle belonged to HIM. \"You made a mistake coming here\" said HIM \"because  I already stole the other 5 gems\" There where 7 gems of power a blue one that was insanely powerful and could destroy a planet with a thought , a red one that could give all the universes knowledge, a purple one that could make your dreams come true, the green one well I told you about it last book, and last (out of the ones he has)the orange one that could create a structure with only the limit of your imagination.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>well thats the end of book 2 read book 3 tomorrow</p>\n<!-- /wp:paragraph -->', 'The Universe 2', '', 'publish', 'open', 'open', '', 'the-universe-2', '', '', '2021-12-15 01:14:52', '2021-12-15 01:14:52', '', 0, 'https://orin.fuzzylojic.com/?p=151', 0, 'post', '', 2),
