reams come true, the green one well I told you about it last book, and last (out of the ones he has)the orange one that could create a structure with only the limit of your imagination. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>book 3 Super F flew to the castle as The Universe shot a laser beam at HIM. The huge explosion it made on impact made HIM drop the blue stone but he immediately grabbed the stone but with another blast he dropped the orange stone which The Universe grabbed and made a cage around HIM, but he immediately broke out and grabbed a huge golden sword with seven holes in it and stuck the gems into the holes with a rainbowish glow the sword became a weapon that only a god could hold and a mortal of HIMs power could barely hold it and with that opportunity The Universe used all of his power and shot HIM. He did not ever recover fully but he did join a hero team on earth called, The Earth\'s Hero\'s.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":311,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/04/DIUWEHRUTNWUKG5U7JFFFFFFFFFFFFFFFFF.jpg\" alt=\"\" class=\"wp-image-311\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>that\'s the end of book 1-3 but in his next fight well lets just say Super F will do more than just watch.</p>\n<!-- /wp:paragraph -->', 'The Universe 1-3', '', 'publish', 'open', 'open', '', 'the-universe-1-3', '', '', '2022-04-19 14:58:52', '2022-04-19 14:58:52', '', 0, 'https://orin.fuzzylojic.com/?p=155', 0, 'post', '', 1),
