evel\":5} -->\n<h5></h5>\n<!-- /wp:heading -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Orin\'s Travels', '', 'inherit', 'closed', 'closed', '', '114-revision-v1', '', '', '2022-01-19 16:57:48', '2022-01-19 16:57:48', '', 114, 'https://orin.fuzzylojic.com/?p=194', 0, 'revision', '', 0),
(195, 3, '2022-01-19 17:27:50', '2022-01-19 17:27:50', '<!-- wp:paragraph -->\n<p>warning this book contains violence </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This story starts in antarctica where a man is lost in a blizzard unaware of the beast heading towards him.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The monster is close and it hears its prey and pounces at the man and takes out his claws but stops he still retains some human in him and falls unconscious, he is found in the snow 5 days later and is brought to a hospital the doctors are shocked that he is still alive but the doctors lives are taken when he wakes up. 5 YEARS EARLIER. A secret military compound and its main scientist was looking into genetic enhancement and using a salamanders dna a gorillas strength and a cheetahs speed he was able to create a step by step physical enhancement machine he told his assistant to test it on him. STEP 1) use the serum to give regeneration super strength and cheetah speed. STEP 2) replace his bones with titanasteel and completely fill the body with titanasteel but still have working organs. STEP 3) attach the artificial claws. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>THE END FOR NOW</p>\n<!-- /wp:paragraph -->', 'The killer', '', 'publish', 'open', 'open', '', 'the-killer', '', '', '2022-02-01 14:54:27', '2022-02-01 14:54:27', '', 0, 'https://orin.fuzzylojic.com/?p=195', 0, 'post', '', 0),
