(203, 3, '2022-01-26 15:09:41', '2022-01-26 15:09:41', '<!-- wp:paragraph -->\n<p>I like minecraft, Magic the gathering, Marvel, and math. I am in 4th grade my brother is the admin of finneas.fuzzylojic.com. I also like among us. I am going to mexico, peru, ecuador, and then costa rica. I am live in portland oregon usa. I know kung fu, akido, and have an IQ of 146</p>\n<!-- /wp:paragraph -->', 'About me', '', 'inherit', 'closed', 'closed', '', '85-revision-v1', '', '', '2022-01-26 15:09:41', '2022-01-26 15:09:41', '', 85, 'https://orin.fuzzylojic.com/?p=203', 0, 'revision', '', 0),
(205, 3, '2022-01-27 17:43:13', '2022-01-27 17:43:13', '<!-- wp:paragraph -->\n<p>There was once a race of humanoid people that lived in harmony with the other planets and each other. The planet had rulers that were also there best warriors they had a baby but as he was being born the planet was attacked by there only enemy inferno the god of fire. Inferno destroyed everything and killed everyone except one the newborn baby that had been proficed to be the most powerful and the weakest of all there kind. The child was found by Inferno ,he knew that the child would be too good of an asset to let die so he took him and named him Infinite for the power he had. Over the years Infinite grew in power and resent for inferno he knew something was different but he never knew that he was really a astopian. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The End For now</p>\n<!-- /wp:paragraph -->', 'Infinite', '', 'publish', 'open', 'open', '', 'infinite', '', '', '2022-01-27 17:44:14', '2022-01-27 17:44:14', '', 0, 'https://orin.fuzzylojic.com/?p=205', 0, 'post', '', 0),
(206, 3, '2022-01-27 17:43:13', '2022-01-27 17:43:13', '<!-- wp:paragraph -->\n<p>There was once a race of humanoid people that lived in harmony with the other planets and each other. The planet had rulers that were also there best warriors they had a baby but as he was being born the planet was attacked by there only enemy inferno the god of fire. Inferno destroyed everything and killed everyone except one the newborn baby that had been proficed to be the most powerful and the weakest of all there kind. The child was found by Inferno ,he knew that the child would be too good of an asset to let die so he took him and named him Infinite for the power he had. Over the years Infinite grew in power and resent for inferno he knew something was different but he never knew that he was really a astopian. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The End For now</p>\n<!-- /wp:paragraph -->', 'Infinite', '', 'inherit', 'closed', 'closed', '', '205-revision-v1', '', '', '2022-01-27 17:43:13', '2022-01-27 17:43:13', '', 205, 'https://orin.fuzzylojic.com/?p=206', 0, 'revision', '', 0),
(208, 3, '2022-01-30 23:50:51', '2022-01-30 23:50:51', '<!-- wp:paragraph -->\n<p>warning this book contains violence </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This story starts in antarctica where a man is lost in a blizzard unaware of the beast heading towards him.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The monster is close and it hears its prey and pounces at the man and takes out his claws but stops he still retains some human in him and falls unconscious, he is found in the snow 5 days later and is brought to a hospital the doctors are shocked that he is still alive but the doctors lives are taken when he wakes up. 5 YEARS EARLIER. A secret military compound and its main scientist was looking into genetic enhancement and using a salamanders dna a gorillas strength and a cheetahs speed he was able to create a step by step physical enhancement machine he told his assistant to test it on him. STEP 1) use the serum to give regeneration super strength and cheetah speed. STEP 2) replace his bones with titanasteel and completely fill the body with titanasteel but still have working organs. STEP 3) attach the artificial claws. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>THE END FOR NOW</p>\n<!-- /wp:paragraph -->', 'The killer', '', 'inherit', 'closed', 'closed', '', '195-autosave-v1', '', '', '2022-01-30 23:50:51', '2022-01-30 23:50:51', '', 195, 'https://orin.fuzzylojic.com/?p=208', 0, 'revision', '', 0),
(209, 3, '2022-02-01 14:54:27', '2022-02-01 14:54:27', '<!-- wp:paragraph -->\n<p>warning this book contains violence </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This story starts in antarctica where a man is lost in a blizzard unaware of the beast heading towards him.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The monster is close and it hears its prey and pounces at the man and takes out his claws but stops he still retains some human in him and falls unconscious, he is found in the snow 5 days later and is brought to a hospital the doctors are shocked that he is still alive but the doctors lives are taken when he wakes up. 5 YEARS EARLIER. A secret military compound and its main scientist was looking into genetic enhancement and using a salamanders dna a gorillas strength and a cheetahs speed he was able to create a step by step physical enhancement machine he told his assistant to test it on him. STEP 1) use the serum to give regeneration super strength and cheetah speed. STEP 2) replace his bones with titanasteel and completely fill the body with titanasteel but still have working organs. STEP 3) attach the artificial claws. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>THE END FOR NOW</p>\n<!-- /wp:paragraph -->', 'The killer', '', 'inherit', 'closed', 'closed', '', '195-revision-v1', '', '', '2022-02-01 14:54:27', '2022-02-01 14:54:27', '', 195, 'https://orin.fuzzylojic.com/?p=209', 0, 'revision', '', 0),
(210, 3, '2022-02-01 18:08:24', '2022-02-01 18:08:24', '<!-- wp:image {\"id\":211,\"width\":836,\"height\":630,\"sizeSlug\":\"large\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-large is-resized is-style-default\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/02/crocdil-1024x768.jpg\" alt=\"\" class=\"wp-image-211\" width=\"836\" height=\"630\"/><figcaption>this is a crocodile I saw in the mangrove where I took a boat to see these flamingos uh down arrow.</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":212,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/02/flemingos-1024x768.jpg\" alt=\"\" class=\"wp-image-212\"/><figcaption>these are the flamingos I saw but there was a HOLE LOT MORE. The water was pink water close to were most of the flamingos were and the flamingos are pink because they eat Phoenicopterus.<br><br></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":213,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/02/more-flemin-gos-1024x482.jpg\" alt=\"\" class=\"wp-image-213\"/><figcaption>more flamingos.</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'My trip to Celestun in my bigger trip to alot of places', '', 'publish', 'open', 'open', '', 'my-trip-to-celestun-in-my-bigger-trip-to-alot-of-places', '', '', '2022-03-17 15:26:13', '2022-03-17 15:26:13', '', 0, 'https://orin.fuzzylojic.com/?p=210', 0, 'post', '', 2),
