(238, 3, '2022-02-17 20:05:05', '2022-02-17 20:05:05', '<!-- wp:paragraph -->\n<p>I went to chichen itza it was built by the mayans and they built a lot. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When I went there there was a lot of other \"tourists\" here\'s one of the pictures I took of the biggest and first thing I saw.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":231,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/02/100_0218-1024x768.jpg\" alt=\"\" class=\"wp-image-231\"/></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph -->\n<p>This is what I saw when I went in - the me in the picture here\'s some more pictures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":232,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/02/100_0223-1024x768.jpg\" alt=\"\" class=\"wp-image-232\"/><figcaption>The warrior temple, on each standing stone there\'s a carving of a warrior</figcaption></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":233,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/02/100_0220-1024x768.jpg\" alt=\"\" class=\"wp-image-233\"/><figcaption>This is the pok pok thingy the biggest stadium in the world</figcaption></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":234,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/02/100_0235-1024x768.jpg\" alt=\"\" class=\"wp-image-234\"/><figcaption>Some more ruins that I don\'t know the name of</figcaption></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":235,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/02/100_0230-1024x768.jpg\" alt=\"\" class=\"wp-image-235\"/><figcaption>I think this is the platform of venus or its the platform of the eagle and the jaguar</figcaption></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":236,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/02/100_0222-1024x768.jpg\" alt=\"\" class=\"wp-image-236\"/><figcaption>This is a perspective picture of the temple of Kukulcán</figcaption></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph -->\n<p>so that was most of the pictures I took but it was pretty cool over all and imagine building these in the gulf of mexico all day for most of your life.</p>\n<!-- /wp:paragraph -->', 'my 4 hour trip at chichen itza', '', 'inherit', 'closed', 'closed', '', '230-revision-v1', '', '', '2022-02-17 20:05:05', '2022-02-17 20:05:05', '', 230, 'https://orin.fuzzylojic.com/?p=238', 0, 'revision', '', 0),
(240, 3, '2022-02-28 21:12:30', '2022-02-28 21:12:30', '<!-- wp:paragraph -->\n<p>I went to uxmal another ruin of the maya. I also went to choco factory where they had kinda a lot of stuff but most importantly monkeys you could feed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":241,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/02/oosh-mal.jpg\" alt=\"\" class=\"wp-image-241\"/><figcaption>oosh mal the first thing you see be dis</figcaption></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":242,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/02/monkys.jpg\" alt=\"\" class=\"wp-image-242\"/><figcaption>monkeys</figcaption></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":244,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/02/choco-fac.jpg\" alt=\"\" class=\"wp-image-244\"/></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph -->\n<p>In choco factory there was a thing where they showed pealpole how to make mayan choclate drinks we drank all. I was sick that day so  this is all I realy remember</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>more ruins</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-blo