(303, 3, '2022-04-19 14:00:16', '2022-04-19 14:00:16', '<!-- wp:paragraph -->\n<p> The big bang may have started the universe but a question that has been on the minds of many scientists is what caused the big bang and that is a hero called The Universe. He was born at the start of time outside of time he used the power he knew he had and created the universe, then out of nowhere two big...humans\"?\" told him to make this oath to gain his full power so he did. \"I The Universe swear to protect the entire universe at all costs.\" A huge explosion (AKA the big bang) gave him his full power. 14,000,000,000 years later. The human known as super F in his secret identity Finneas Enniott was walking down the street to the pet store, BOB\'S PETS. He went in and bought a green rabbit and a blue cat the most rare pets costing 1,000,000 dollars. Then, a strange blue man with gold and black armor and green ovals on his arms took his rabbit and ripped a green gem out of it\'s body and teleported away. The Universe  flew down and told him that he knew his secret identity. That was a villain called HIM. And that the gem had the power of space and time and you could also teleport with it and that the fate of the universe depended on them.  book 2 In the last book we \"saw\" The Universe\'s origin and the begging of time. There was also a villain that never did much but lets just start this story. The Universe and super F where transported to a black room. \"We are now in the training room\" Said The Universe \"Here you will be challenged and trained\" \"Goodbye\" BZZT The Universe teleported away to a huge castle made with ruby\'s and something related to dark matter. The castle belonged to HIM. \"You made a mistake coming here\" said HIM \"because  I already stole the other 5 gems\" There where 7 gems of power a blue one that was insanely powerful and could destroy a planet with a thought , a red one that could give all the universes knowledge, a purple one that could make your dreams come true, the green one well I told you about it last book, and last (out of the ones he has)the orange one that could create a structure with only the limit of your imagination. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>book 3 Super F flew to the castle as The Universe shot a laser beam at HIM. The huge explosion it made on impact made HIM drop the blue stone but he immediately grabbed the stone but with another blast he dropped the orange stone which The Universe grabbed and made a cage around HIM, but he immediately broke out and grabbed a huge golden sword with seven holes in it and stuck the gems into the holes with a rainbowish glow the sword became a weapon that only a god could hold and a mortal of HIMs power could barely hold it and with that opportunity The Universe used all of his power and shot HIM. He did not ever recover fully but he did join a hero team on earth called, The Earth\'s Hero\'s.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>that\'s the end of book 1-3 but in his next fight well lets just say Super F will do more than just watch.</p>\n<!-- /wp:paragraph -->', 'The Universe 1-3', '', 'inherit', 'closed', 'closed', '', '155-revision-v1', '', '', '2022-04-19 14:00:16', '2022-04-19 14:00:16', '', 155, 'https://orin.fuzzylojic.com/?p=303', 0, 'revision', '', 0),
