(307, 3, '2022-04-19 14:50:49', '2022-04-19 14:50:49', '<!-- wp:paragraph -->\n<p>I recently went to costa rica thats why its 9:01 for me but 8:01 for the U.S.A witch is where I used to live.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":253,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/03/ahhhhhhhhhhhhhhhhhhhhhh-the-costa-ricansons.jpg\" alt=\"\" class=\"wp-image-253\"/></figure>\n<!-- /wp:image --><figcaption class=\"blocks-gallery-caption\">ahhhhhhhhhhhhhhhhhhhhhhhhh the costaricansons</figcaption></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph -->\n<p>So far I have been to the beach witch is a 10/5 minute walk away from my house I am in samara btw. Tambien hice fuego en la playa durante la noche, vi 13 monos sin incluir a los bebes. If you know espanol/spanish then you can translate it or you can use google translate. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":254,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/03/image.png\" alt=\"\" class=\"wp-image-254\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":255,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/03/monky-but-I-saw-it.jpg\" alt=\"\" class=\"wp-image-255\"/></figure>\n<!-- /wp:image --><figcaption class=\"blocks-gallery-caption\">this is one of the howler monkeys I saw</figcaption></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img alt=\"\"/></figur