(349, 3, '2022-05-19 17:03:16', '2022-05-19 17:03:16', '<!-- wp:image {\"id\":350,\"width\":840,\"height\":472,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/05/first-battle-scene-BIG-1024x576.png\" alt=\"\" class=\"wp-image-350\" width=\"840\" height=\"472\"/><figcaption>you might think writing is easy, well it is except for the start so if the start is bad then now you know why</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>A team was created to protect from mainly extraterrestrials they never settled on a name but the team consisted of multiple heroes some known some not. The American soldier, the iron soldier, infinite, the killer, mage, plant thing, and HIM. These heroes where very powerful human or not they could destroy and create, they where THE EARTHS HEROS. It was a normal day in Salem, Oregon it was raining hard and covid was getting better the year 2024 a shadow was cast in front of the sun in the shape of a humanoid figure. A loud voice telling the humans to say there last words, breath there last breath because he was  iisheae a radiation needing alien he planned on stealing earths radiation which would destroy the earth a \"minor sacrifice\". The heros needed a plan but they had no way of getting to him in time luckily they had plant thing and mage. Mage could teleport them to iisheae and plant thing could provide oxygen. So they teleported to iisheae but his helmet was insanely thick but thats where infinite came in he could plunge his sword into the helmet, cracking it* they then infiltrated his helmet. They didn\'t realize that his helmet used not oxygen but mercery they started breathing it but started losing consciousness quickly and luckily they air slowly left and plant thing created oxygen by turning into a tree. Unknowingly iisheae started emitting radiation to kill the \"pesky gnats\" but The American soldier knew when pollution starts and he knew he had to do something so he shot his star at the eye of iisheae and the killer knew when a battle was about to start so he used his metal knife things and started his other persona and fought.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":353,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/05/epic-fight-1-1024x576.png\" alt=\"\" class=\"wp-image-353\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Infinite could control the elements so he used the power of earth, water, fire, air, lightning, and storm he used these on iisheae to give them an advantage while stabbing him with his titanasteel sword. The iron soldier a robot calculated that if he hit iisheae from the inside he could kill him but stupidly said it out loud he managed to cut iisheae open but iisheae teleported away but not after killing 1,000,000,000 people. The remaining 9,000,000,000 people continued there life because he only really killed the jerky rich people so everyone got more money but they got greedy and life was almost back to normal (besides the fact that 1,000,000,000 people died so everyone was really sad)    </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>*remember this</p>\n<!-- /wp:paragraph -->', 'The Earths Heros #1', '', 'publish', 'open', 'open', '', 'the-earths-heros-1', '', '', '2022-05-26 16:22:02', '2022-05-26 16:22:02', '', 0, 'https://orin.fuzzylojic.com/?p=349', 0, 'post', '', 0),
