(363, 3, '2022-05-25 16:23:43', '2022-05-25 16:23:43', '<!-- wp:paragraph -->\n<p>So technically I wrote this in second grade so this is my best memory of the story (2nd grade)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>on an island there was a jungle a river animal tribes and...factory with a lava lake surrounding it. This island was the only non polluted place in all the Americas but the factory was changing this, of course The American soldier could not let his home be destroyed there was animals from all over the world if that island was destroyed than they would all die. \"Bobs tires\" that was the name of this factory. The American soldier (tas for short) went to this lava lake he knew he couldn\'t cross it then he realized he had trees everywhere he cut one down pushed it over and made a bridge. The American soldier knew that this bridge would burn so he ran as fast as possible but it burnt before he could cross it he was hanging on the the ledge with one hand, suddenly a robot appeared and he took this chance he yelled \"HELP!!\" to get the robots attention when it came over he used his other hand and grabbed the robot throwing it in and pushing himself up when he entered the factory there where a dozen more robots he destroyed them but then the door to another room was smashed open and there was a man then everything went black. When The American soldier woke up he was strapped to a board with injections closing in on him when the man came in and said that this would make him stronger than any man but he would follow orders from him the injections injected he tried to resist it (now to make it so you dont know if he\'s evil or not enjoy this)The American soldierThe American soldierThe American soldierThe American soldierThe American soldierThe American soldierThe American soldierThe American soldierThe American soldierThe American soldierThe American soldierThe American soldierThe American soldierThe American soldierThe American soldierThe Ame