(366, 3, '2022-05-26 16:19:51', '2022-05-26 16:19:51', '<!-- wp:paragraph -->\n<p>A abandoned military compound was found with dry blood and holes in it. The killer a monstrous human who had DID (dissociative identity disorder) multiple personalities, one a hero on a team of other hero\'s the other a murderous killer who killed everything around him.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":367,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/05/fly-is-ded-1024x576.png\" alt=\"\" class=\"wp-image-367\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Even though his other was insane he had to use him sometimes like while fighting <strong>isheae</strong>. The end of the killers mind was near his other was killing everyone important to him when his brother came and tried to get him to stop, he nearly was killed until the killer was stabbed by his only enemy gamemaster the killer tried to stab him back but was then teleported to the newest game, sword blast. The boss was gamemaster and his goal was to claim the master key to unlock the door to gamemasters castle and kill him he started in the tutorial where he was greeted by a wolf the wolf said to collect the heart orbs and then he could leave the tutorial so he did and left he then had to fight the mini boss land_shark. Land_shark was well a land shark and he obviously stood no chance he was immediately stabbed and died then the other mini boss water_monkey also died in one hit then in the forest of lost souls and acquired the master key and went to the castle where both mini bosses where and gamemaster with a red glow. The extra powerful bosses where still one hit  and he returned home after killing gamemaster .</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A portal opened and a woman of the name deathshot came out and killed the killers brother with a evil look this would be the start of a thousand year battle of books</p>\n<!-- /wp:paragraph -->', 'the killer #2', '', 'publish', 'open', 'open', '', 'the-killer-2', '', '', '2022-05-26 16:20:51', '2022-05-26 16:20:51', '', 0, 'https://orin.fuzzylojic.com/?p=366', 0, 'post', '', 0),
