(429, 3, '2022-06-28 18:38:00', '2022-06-28 18:38:00', '<!-- wp:paragraph -->\n<p> In part 1 we ended with the main villain revealing himself to be fireballs dad, that seems like that cant be true because he\'s a hero in Firespeed but when he was a child he ran away and in this universe he never came back and fireball was never born creating a new, AGE OF HEROES.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Infinite was hit with a cosmic laser having no idea where this came from he looked around and saw a woman who was continuously changing powers he also saw a man he shot lightning at both the man just stood and took the hit while the woman stretched out of range, the man and woman where named Sigma and Pows Sigma could alter his well, density from invincible to you could pass through him. Pows could have any power she wanted but only use one at a time. The American Soldier was punched again and again until he caught a punch of no one then he revealed to be another random guy he was illusion he could make you see things that weren\'t there or the other way around</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'The Combination Of Firespeed And ∞ Part 2', '', 'publish', 'open', 'open', '', 'the-combination-of-firespeed-and-%e2%88%9e-part-2', '', '', '2022-06-28 18:38:00', '2022-06-28 18:38:00', '', 0, 'https://orin.fuzzylojic.com/?p=429', 0, 'post', '', 0),
