(449, 3, '2022-08-30 18:13:26', '2022-08-30 18:13:26', '<!-- wp:paragraph -->\n<p>So first I went to Cartagena it was very hot and we were right next to a beach. We were there for 2 weeks.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We had some sort of \"Fun\".</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":450,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220710_172232616-1024x576.jpg\" alt=\"\" class=\"wp-image-450\"/><figcaption>Street art</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":451,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220710_172012813-1024x576.jpg\" alt=\"\" class=\"wp-image-451\"/><figcaption>A regular road</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":452,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220710_172057454.MP_-1024x576.jpg\" alt=\"\" class=\"wp-image-452\"/><figcaption>Finn and mom</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Next we were in Salento it was by far the best so far. It was a small town the pictures will prove it.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":453,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220716_180538815-1024x576.jpg\" alt=\"\" class=\"wp-image-453\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":454,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220717_183335131-1024x576.jpg\" alt=\"\" class=\"wp-image-454\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":455,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220720_153046552.MP_-1024x576.jpg\" alt=\"\" class=\"wp-image-455\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":456,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220721_151540109-1024x576.jpg\" alt=\"\" class=\"wp-image-456\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":457,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220730_141057444.MP_-1024x576.jpg\" alt=\"\" class=\"wp-image-457\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":459,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220806_160838397.MP_-1024x576.jpg\" alt=\"\" class=\"wp-image-459\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":458,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220807_140105476-1024x576.jpg\" alt=\"\" class=\"wp-image-458\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The last place in Colombia was Bogota (bow-gow-da) it was cold and high.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":460,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220824_194700218.MP_-1024x576.jpg\" alt=\"\" class=\"wp-image-460\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":461,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220826_174731275.MP_-1024x576.jpg\" alt=\"\" class=\"wp-image-461\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:video {\"id\":462} -->\n<figure class=\"wp-block-video\"><video controls src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220824_201626602.mp4\"></video></figure>\n<!-- /wp:video -->\n\n<!-- wp:video {\"id\":463} -->\n<figure class=\"wp-block-video\"><video controls src=\"https://orin.fuzzylojic.com/wp-content/uploads/2022/08/PXL_20220824_201145059.mp4\"></video></figure>\n<!-- /wp:video -->', 'Colombia', '', 'publish', 'open', 'open', '', 'colombia', '', '', '2022-08-30 18:13:26', '2022-08-30 18:13:26', '', 0, 'https://orin.fuzzylojic.com/?p=449', 0, 'post', '', 0),
